const getJSONResponse = (url, errMsg = "Something went wrong") => {
  return fetch(url)
    .then((resp) => {
      if (!resp.ok) {
        throw new Error(`${errMsg} (${resp.status})`);
      }
      return resp.json();
    })
    .catch(errMsg);
};

